          text: "Social Performance Indicators - Labour practices and decent work\nManagement approach\nLA1   Total workforce by employment type, employment contract and region\nLA2   Employee turnover by age group, gender and region....10\nLA4   Percentage of employees covered by collective bargaining agreements....NA\nLA5   Minimum notice period(s) regarding operational changes ....NA\nLA6   Formal joint management-worker health and safety committees....NA\nLA7   Injuries, occupational diseases, lost days, absenteeism and work related fatalities....24\nLA8   Education, training, prevention and risk controlled programmes in place regarding serious  diseases....NA\nLA9   Health and safety topics covered in formal agreements with trade unions....NA\nLA10  Average hours of training each year per employee by employee category....NA\nLA13  Diversity within governance bodies and employee categories....NA\nLA14  Ratio of basic salary of men to women by employee category....NA",
