          id: "faa31080-d79e-4d6b-9f89-a923aaa8ced9",
          text: "Without our employees, Gearbulk would not be the company it is today. Dedication, expertise and hard-work have characterised their efforts both on board vessels and ashore in 2019. As an international company, Gearbulk provides several opportunities for growth and collaboration between colleagues across the organisation and with our business partners. ",
